<!DOCTYPE html>
<html style="height: 100%">
<head>
	<title>Print - Paris, Tx Map Beta 2.0</title>
	<meta charset="utf-8">

	<meta name="viewport" content="width=device-width, initial-scale=1.0">

	<link rel="stylesheet" href="lib/leaflet.css">
    <link rel="stylesheet" href="dist/print.css">

<META name="GENERATOR" content="MSHTML 10.00.9200.16686">

<body>

    <div id="page-content">
        <div id="header">
            <div id="search">
                <input id="searchbox" type="text" placeholder="Enter Parcel ID" onkeypress="keyPressListener(event)">
                <button type="button" onclick="onSearchClick()">Search</button>

            <div id="data-section"><div id="row">Click on the map for data!</div></div>

    </div>

	<script src="lib/leaflet.js"></script>

    <script src="dist/main1.js"></script>

</html>
